import React, { Component } from 'react'
import ReactTable from "react-table";
// import 'react-table/react-table.css'

export default class Table extends Component {
    render() {
        const tableData = [
        { name: 'Naheen', age: 16 },
        { name: 'Mahi', age: 12 },
        { name: 'Raian', age: 14 },
        { name: 'Ani', age: 18 },
        { name: 'Eman', age: 11 },
        { name: 'Hola', age: 2 },
    ]
        const tableColumns = [ { Header: 'Names', accessor: 'name' }, { Header: 'Names', accessor: 'name' } ]
        return (
            <div>
                <ReactTable
                    data={tableData}
                    columns={tableColumns}
                    defaultPageSize={2}
                    pageSizeOptions={[ 2, 4, 6, 8 ]}
                >

                </ReactTable>
            </div>
        )
    }
}
